                    using (var dbContext = new SPToCoreContext())
                    {
                        var val = (List<PosorderDetail>)Changed;
                        foreach (var n in val)
                        {
                            var exists = dbContext.PosorderDetails.FirstOrDefault(o => o.SaleId == n.SaleId && o.ProductCode == n.ProductCode);
                            if (exists != null)
